import {
  Button,
  FormControl,
  InputLabel,
  OutlinedInput,
  TextField,
} from "@mui/material";
import Grid from "@mui/material/Grid";
import Typography from "@mui/material/Typography";
import React from "react";
import { useNavigate } from "react-router-dom";
import { useAppDispatch } from "../../hooks";
import { login } from "../../services/auth.service";
import { setUserData } from "../../storage/auth.storage";

const LoginForm = () => {
  const dispatch = useAppDispatch();
  const navigate = useNavigate();
  const [error, setError] = React.useState(null);

  const onLoginSubmit = (event: React.FormEvent<HTMLFormElement>) => {
    event.preventDefault();

    const email = event.currentTarget.username.value;
    const password = event.currentTarget.password.value;

    login(email, password)
      .then((res) => {
        setUserData(dispatch, res.accessToken, res.refreshToken, {
          userName: res.userName,
          email: res.userEmail,
          roles: res.userRoles,
        });
        setError(null);
        // ..navigate
      })
      .catch((e) => {
        console.log(e);
        // ..error
      });
  };

  return (
    <Grid
      container
      spacing={0}
      direction="column"
      alignItems="center"
      justifyContent="center"
    >
      <Grid item xs={3}>
        <Typography variant="h5">Login</Typography>
        <br />
        <form onSubmit={onLoginSubmit}>
          <TextField type="text" label="Username" variant="outlined" />
          <br />
          <br />
          <TextField type="password" label="Password" variant="outlined" />
          <br />
          <br />
          <Button variant="contained" type="submit" fullWidth>
            Login
          </Button>
        </form>
      </Grid>
    </Grid>
  );
};

export default LoginForm;
